<script>

    $(document).ready(async ()=>
    {
        try
        {
            var videoData = $("#videoData").html();
            var lines = videoData.split("\n");
            var size = lines[0];
            var width = size.split("x")[0];
            var height = size.split("x")[1];
     
            var firstFrameTime = null;
            for(var i = 1; i < lines.length; i++)
            {
                var frame = lines[i];
                var parsedFrame = parseRawFrame(frame, width, height, i+1);
                var time = parsedFrame.time / 10000;
                console.log(parsedFrame.time +" ticks => " + time+" ms");
                var html = getRawFrameHtml(parsedFrame);
                var due = firstFrameTime == null ? new Date() : new Date(firstFrameTime.getTime() + time);
                var delay = due.getTime() - new Date().getTime();
                if(delay > 0)
                {
                    console.log(delay);
                    await sleep(delay);
                }
                $("body").html(html);
            
                if(firstFrameTime == null)
                {
                    firstFrameTime = due;
                }
            }
        }catch(error)
        {
            console.log(error);
        }

    });

    const sleep = (milliseconds) => {
    return new Promise(resolve => setTimeout(resolve, milliseconds))
    }

    function getRawFrameHtml(frame)
    {
        var ret = "<div style='white-space:pre-wrap;font-family:Consolas'>";
        var lastFg = null;
        var lastBg = null;

        for(var y = 0; y < frame.height; y++)
        {
            for(var x = 0; x < frame.width; x++)
            {
                var cell = frame.cells[x][y];
                if(cell.fg != lastFg || cell.bg != lastBg)
                {
                    if(lastFg != null)
                    {
                        ret+="</span>";
                    }

                    lastFg = cell.fg;
                    lastBg = cell.bg;
                    ret+="<span style='color:" + lastFg + ";background-color:" + lastBg + "'>";
                }
                ret+=cell.value;
            }
            ret+="\n";
        }
        ret+="</div>";
        return ret;
    }

    function parseDiffFrame(rawFrame, line, width, height, lineNumber)
    {
        var ret = cloneRawFrame(rawFrame);

    }

    function cloneRawFrame(frame)
    {
        var clone ={ time: frame.time, width: frame.width, height: frame.height, cells: [] };
        for(var x = 0; x < frame.width; x++)
        { 
            clone.cells.push([]);
            for(var y = 0; y < frame.height; y++)
            {
                clone.cells[x][y] = { fg: frame.cells[x][y].fg, bg: frame.cells[x][y].bg, value: frame.cells[x][y].value };
            }
        }
        return clone;
    }

    function parseRawFrame(line, width, height, lineNumber)
    {
        var frame = { time: 0, width: width, height: height, cells: [] };

        var fg = "Gray";
        var bg = "Black";

        var x = 0; 
        var y = 0;
        for(var i = 0; i < line.length; i++)
        {


            if(i == 0)
            {
                frame.cells.push([]);
                var timeInfo = parseDirective(line, i, lineNumber);
                frame.time = parseInt(timeInfo.contents);
                i = timeInfo.seek;

                var rawInfo = parseDirective(line, i, lineNumber);
                if(rawInfo.contents != "Raw") throw "Expected 'Raw', got '"+rawInfo.contents+"' on line "+lineNumber;
                i = rawInfo.seek-1;
            }
            else
            {
                var cellInfo = parseDirective(line, i, lineNumber);
                i = cellInfo.seek-1;
                if(cellInfo.contents.startsWith("F="))
                {
                    fg = cellInfo.contents.split("=")[1];
                }
                else if(cellInfo.contents.startsWith("B="))
                {
                    bg = cellInfo.contents.split("=")[1];
                }
                else
                {
                    if(cellInfo.contents.length != 1)throw "Expected a single character, got '"+cellInfo.contents+"' on line "+lineNumber;;
                    frame.cells[x].push({ fg: fg, bg: bg, value: cellInfo.contents });
                    y++;
                    if(y == height && i != line.length-1)
                    {
                        frame.cells.push([]);
                        x++;
                        y = 0;
                    }
                }
            }
        }
        return frame;
    }

    function parseDirective(line,col, lineNumber)
    {
        var open = line[col];
        if(open != '[') throw "Expected [, got "+open +" on line "+lineNumber+" col "+col;
        var contents = "";
        var j;
        for (j = col+1; j < line.length; j++)
        {
            if(line[j] == ']')
            {
                if(contents == "OB")
                {
                    contents = '[';
                }
                else if(contents == "CB")
                {
                    contents = ']';
                }

                return { contents: contents, seek: j+1 };
            }
            else 
            {
                contents+=line[j];
            }
        }
   
    }
